import React from 'react'
import "./login.css";


function login()
{
    return(
        <div>
            <div>
            <h2>Login Page</h2>
            </div>
            <div>
                <form>
                    <input type = 'email' name = 'email' placeholder = 'Rmail' required/>
                    <button> Log In</button>
                </form>
            </div>


        </div>
    )
}

export default login;
